import { createApp } from 'vue';
import App from './App.vue';
import { createRouter, createWebHistory } from 'vue-router';
import PageSchedule from './components/page/PageSchedule.vue';
import PageEstablish from './components/page/PageEstablish.vue';
import ScreenAuthority from './components/screen/ScreenAuthority.vue';
import ScreenUser from './components/screen/ScreenUser.vue';
import ScreenUserGroup from './components/screen/ScreenUserGroup.vue';
const routers = [{
  path: "/schedule",
  component: PageSchedule
}, {
  path: "/mission",
  component: PageSchedule
}, {
  path: "/transport",
  component: PageSchedule
}, {
  path: "/advance",
  component: PageSchedule
}, {
  path: "/pay",
  component: PageSchedule
}, {
  path: "/establish",
  component: PageEstablish,
  children: []
}, {
  path: "/user",
  component: ScreenUser
}, {
  path: "/user-group",
  component: ScreenUserGroup
}, {
  path: "/establish/authority",
  component: ScreenAuthority
}, {
  path: "/establish/digital-sign",
  component: ScreenAuthority
}];
const router = createRouter({
  history: createWebHistory(),
  routes: routers
});
const app = createApp(App);
app.use(router).mount('#app');
